import React, { Component } from 'react';
import './Login.css';

class Login extends Component {
  constructor() {
    super()
    this.state = {
      email: '',
      password: ''
    }
  }

  render() {
    return (
      <div className='l-container'>
        <h1>Mentor Login</h1>
          <form className='l-form'>
            <input className='l-input' type='text' value={this.state.email} placeholder='Enter your email address, mthfkr.'/>
            <input className='l-input' type='password' value={this.state.password} placeholder='Enter your password, mthfkr.'/>
            <button className='l-login-btn'>Login</button>
          </form>
      </div>
      )
  }
}

export default Login;
